import { AtributosBase } from "../atributosBase/atributosBase.model";

export class Boss {
  vida: number;
  atributosBase: AtributosBase;
  constructor() {
    this.vida = Math.floor(Math.random()*(300 - 51) + 51)
    this.atributosBase = new AtributosBase(
      Math.floor(Math.random()*(10 - 7) + 7),
      Math.floor(Math.random()*(10 - 7) + 7),
      Math.floor(Math.random()*(10 - 7) + 7),
      0, 0, 0, 0
    )
  }
}
